    histogram('a b c a b') == {'a': 2, 'b': 2}
    histogram('b b b b a') == {'b': 4}
    histogram('') == {}
    """

    # Split the input string into a list of characters
    chars = test.split()

    # Create an empty dictionary to store the letter counts
    counts = {}

    # Iterate over the list of characters and update the counts dictionary
    for char in chars:
        if char in counts:
            counts[char] += 1
        else:
            counts[char] = 1

