    def empty_well(grid, row, column, bucket_capacity, filled):
        if filled == capacity:
            return 0

        if row >= len(grid) or column >= len(grid[0]):
            return math.inf

        if grid[row][column] == 1 and filled + 1 <= capacity:
            grid[row][column] = 0
            filled += 1
            return min(empty_well(grid, row + 1, column, bucket_capacity, filled),
                       empty_well(grid, row, column + 1, bucket_capacity, filled)) + 1
